import React from 'react';
import { BarChart, Bar,ResponsiveContainer, XAxis, YAxis, Tooltip, Legend} from 'recharts';

const SkillCharts = () => {
    const data = [
        {
          name: 'React', Skills: 9000, pv: 2400, amt: 200,
        },
        {
          name: 'JavaScript', Skills: 3000, pv: 1398, amt: 2210,
        },
        {
          name: 'CSS', Skills: 2000, pv: 9800, amt: 2290,
        },
        {
          name: 'HTML', Skills: 2780, pv: 3908, amt: 2000,
        },
        {
          name: 'PHP', Skills: 1890, pv: 4800, amt: 2181,
        },
      ];

    return(
        <ResponsiveContainer>
            <BarChart width={150} height={40} data={data}>
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Bar dataKey="Skills" fill="#8884d8" />
            </BarChart>
        </ResponsiveContainer>
    );
}

export default SkillCharts;
